import React, { Component } from 'react';
import './form/form.css';

class Form extends Component {
  
  render() { 
    return (
      <div>
<form>
      <label>First Name:</label>
      <input type='text'/><br />
      <label>Surname:</label>
      <input type='text'/><br />
      <label>Email:</label>
      <input type='email'/><br />
      <label>Phone Number:</label>
      <input type='number'/><br />
      <input type="Submit" />
      </form>
      </div>

      
      
    );
  }
}
 
export default Form;
